from dataclasses import field
from typing import Optional

from dataclasses_json import dataclass_json, LetterCase
from dataclasses import dataclass


@dataclass_json(letter_case=LetterCase.CAMEL)
@dataclass
class PgNetBankingBank:
    bank_id: Optional[str] = field(default=None)
    bank_name: Optional[str] = field(default=None)
    bank_short_name: Optional[str] = field(default=None)
    available: Optional[str] = field(default=None)
    account_constraint_supported: Optional[bool] = field(default=None)
    priority: Optional[int] = field(default=None)
